    return (
        <>
            <div className='section5'>
                <div className='sec5content'>
                <p>WHY CHOOSE US</p>
                <h4 className='sec5head'>Experience Unmatched Trust, Confidence, Privacy, and Time Efficiency in Real Estate</h4>
           
                </div>
                </div>
        </>
    )
}
export default Section4;
